import React from 'react'

const ProductBar = () => {

    return(
        <div style={{backgroundColor: '#f4f4f5'}}>
                
            <p className="pt-3 pb-3" style={{marginLeft: '-700px'}}>
                <a href="#" style={{color: '#6C7279'}}>Products</a> / Create a new purchased product
            </p>

        </div>
    )
}

export default ProductBar;
